    <>
        <List
          footer={<div><Pagination current={state.current} onChange={onChange} total={props.data.totalPages} /></div>}
          dataSource={props.data.content}
          renderItem={item => (
            <List.Item>
              <Typography.Text mark>{item.id}</Typography.Text> {item.ltName}
            </List.Item>
          )}
        />,
    </>
    );
}

